import React, { Component } from "react";
import { render } from "react-dom";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";
import "./App.css";

const options = {
  chart: {
    type: "spline",
  },
  xAxis: {
    categories: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun',
      'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'
    ]
  },
  title: {
    text: "My chart",
  },
  series: [
    {
      data: [1, 2, 1, 4, 3, 6],
    },
  ],
};

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { data: "" };
  }

  callAPI() {
    fetch("http://localhost:9000/testAPI")
      .then((res) => res.json())
      .then((res) => {
        console.log(res["Time Series (Daily)"]);
        this.setState({ data: res });
      })
      .catch((err) => err);
  }

  componentDidMount() {
    this.callAPI();
  }
  render() {
    if (this.state.data) {
      // const parsedDates = Object.keys(
      //   this.state.data["Time Series (Daily)"]
      // ).map((date) => date.replace(/-/gi, "."));

      const dateArray = Object.entries(
        this.state.data["Time Series (Daily)"]
      ).map(date => date[0].replace(/-/gi, "."))
      console.log(Object.entries(
        this.state.data["Time Series (Daily)"]
      ))
      const priceArray = Object.entries(
        this.state.data["Time Series (Daily)"]
      ).map(date => Math.round(parseFloat(date[1]['4. close'])))
      console.log(priceArray)
      // .map((date) => date['4. close']);
    }
    return (
      <div className="App">
        <HighchartsReact highcharts={Highcharts} options={options} />

        {/* <p className="App-intro">{this.state.apiResponse}</p> */}
      </div>
    );
  }
}

export default App;
